import React from "react";
import "./Receipt.css";
import { connect } from "react-redux";

const Receipt = ({ name, source, time }) => {
  return (
    <table className="receipt-table">
      <thead className="receipt-table__head">
        <tr>
          <th>Receipt Name</th>
          <th>Receipt Source</th>
          <th>Receipt Time</th>
        </tr>
      </thead>
      <tbody className="receipt-table__body">
        <tr>
          <td>{name}</td>
          <td>{source}</td>
          <td>{time}</td>
        </tr>
      </tbody>
    </table>
  );
};

export default Receipt;
